import React, { useState } from 'react';
import '../styles/ControlPanel.css';

function ControlPanel() {
    const [signal, setSignal] = useState('Green');

    const handleSignalChange = (newSignal) => {
        setSignal(newSignal);
        console.log(`Traffic signal changed to ${newSignal}`);
    };

    return (
        <div className="control-panel">
            <h2>Control Panel</h2>
            <button onClick={() => handleSignalChange('Green')}>Green</button>
            <button onClick={() => handleSignalChange('Yellow')}>Yellow</button>
            <button onClick={() => handleSignalChange('Red')}>Red</button>
            <p>Current Signal: {signal}</p>
        </div>
    );
}

export default ControlPanel;
